import React, { useState } from 'react';
import { Form, Header, Button, Icon, Label, Menu, Table, ItemDescription } from 'semantic-ui-react'
import { useDispatch, useSelector } from "react-redux";

export const RowCard = (item) => {  
    return (
        <Table.Row active="true">
            <Table.Cell selectable="true">{item.item.name}</Table.Cell>
            <Table.Cell selectable="true">{item.item.description}</Table.Cell>
            <Table.Cell selectable="true">{item.item.family}</Table.Cell>
            <Table.Cell selectable="true">{item.item.hp}</Table.Cell>
            <Table.Cell selectable="true">{item.item.energy}</Table.Cell>
            <Table.Cell selectable="true">{item.item.defense}</Table.Cell>
            <Table.Cell selectable="true">{item.item.attack}</Table.Cell>
            <Table.Cell selectable="true">{item.item.price}</Table.Cell>
        </Table.Row>
    );
}
